import {useState} from 'react';
import "./Display.css";

const Display = ({contract, account}) => {
  return <div>
    <div className='image-list'>Image Display</div>
    <input type="text" placeholde="Enter Address" className="address"></input>
    <button className='center button' onClick>Get Data</button>
  </div>;
};

export default Display;
